import React, { useState } from "react";
import { AppBar, Toolbar, Button, Menu, MenuItem, Typography, IconButton, Box, Avatar } from "@mui/material";
import ShoppingCartOutlined from '@mui/icons-material/ShoppingCartOutlined';
import AccountCircle from '@mui/icons-material/AccountCircle';

function Navbar() {
  const [profileAnchor, setProfileAnchor] = useState(null);
  const [orderAnchor, setOrderAnchor] = useState(null);

  return (
    <AppBar sx={{ backgroundColor: "#e53935", minHeight: 64 }} position="static">
      <Toolbar>
        <Typography variant="h6" sx={{ fontWeight: 700, mr: 3 }}>FUELnow</Typography>
        <Button color="inherit">HOME</Button>
        <Button color="inherit" onClick={e => setOrderAnchor(e.currentTarget)}>ORDER</Button>
        <Menu anchorEl={orderAnchor} open={Boolean(orderAnchor)} onClose={() => setOrderAnchor(null)}>
          <MenuItem onClick={() => setOrderAnchor(null)}>Place an Order</MenuItem>
          <MenuItem onClick={() => setOrderAnchor(null)}>My Cart</MenuItem>
          <MenuItem onClick={() => setOrderAnchor(null)}>My Orders</MenuItem>
        </Menu>
        <Button color="inherit">REPORTS</Button>
        <Button color="inherit">CUSTOMER SERVICES</Button>
        <Box sx={{ flexGrow: 1 }} />
        <IconButton sx={{ color: "#fff", mr: 1 }}>
          <ShoppingCartOutlined />
          <Box sx={{ ml: 0.5, fontSize: 14, bgcolor: "#f00", color: "#fff", borderRadius: "50%", px: 1 }}>0</Box>
        </IconButton>
        <Button sx={{ textTransform: "none", color: "#fff" }} onClick={e => setProfileAnchor(e.currentTarget)}>
          Hello, Jai Devarajan <AccountCircle sx={{ ml: 1 }} />
        </Button>
        <Menu
          anchorEl={profileAnchor}
          open={Boolean(profileAnchor)}
          onClose={() => setProfileAnchor(null)}
          sx={{ mt: 2 }}
        >
          <Box sx={{ px: 2, pt: 2, minWidth: 220 }}>
            <Avatar sx={{ width: 60, height: 60, bgcolor: "#eee", mb: 1.5 }} />
            <Typography sx={{ fontWeight: "bold", textTransform: "lowercase", mb: 1 }}>jai devarajan</Typography>
            <Button variant="outlined" size="small" sx={{ mb: 1 }}>Edit Profile</Button>
          </Box>
          <MenuItem>Update Mobile</MenuItem>
          <MenuItem>Update Email</MenuItem>
          <MenuItem>Update Password</MenuItem>
          <MenuItem sx={{ color: "#e53935", fontWeight: 700 }}>Log Out</MenuItem>
        </Menu>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
